import React from "react";

export default function CV() {
    return (   
        <main>
            <h1>ELIJejd</h1>
            <div className="container">
                <h2>Formation académique</h2>    
                <hr className="divider"></hr>
                <div className="jsp">
                    <dt>2018-2020</dt>
                </div>
                <div className="jsp2">
                    <dd>
                        CPGE PCSI-PSI au lycée Louis Barthou à Pau
                    </dd>
                </div>
            </div>
        </main>
    );
}
